import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = (props) => {
    return (
        <li>
            <Link href={`/post?title=${props.title}`}>
                <a>{props.title}</a>
            </Link>
        </li>
    );
}

const Index = () => {
    return (
        <Layout>
            <p>This is Hello Page.</p>
        </Layout>
    );
}

export default Index;
